// React
import React, { Fragment } from "react";

// Third pard
import { Row, Col, Form, Input, Button, Typography } from "antd";

// custom
import "../../assets/css/LoginForm.css";

const { Title } = Typography;

const layout = {
  labelCol: {
    span: 8
  },
  wrapperCol: {
    span: 16
  }
};
const tailLayout = {
  wrapperCol: {
    offset: 8,
    span: 16
  }
};

const SignIn = () => {
  const onFinish = values => {
    console.log(values);
  };

  const onFinishFailed = errorInfo => {};

  return (
    <Fragment>
      <Row>
        <Col xs={10} xl={10} md={10}>
          <div>
            <img
              alt="restaurant"
              style={{ width: "100%" }}
              src="https://images.unsplash.com/photo-1537047902294-62a40c20a6ae?ixlib=rb-1.2.1&ixid=eyJhcHBfaWQiOjEyMDd9&auto=format&fit=crop&w=1275&q=80"
            />
          </div>
        </Col>
        <Col xs={{ span: 10, offset: 2 }} xl={{ span: 10, offset: 1 }}>
          <Form
            {...layout}
            name="loginForm"
            onFinish={onFinish}
            onFinishFailed={onFinishFailed}
            className="form"
          >
            <Form.Item>
              <Title style={{ textAlign: "center" }}>Welcome Restaurant</Title>
            </Form.Item>
            <Form.Item
              label="Email"
              name="Email"
              rules={[
                {
                  required: true,
                  type: "email",
                  message: "Please input your Email!"
                }
              ]}
            >
              <Input />
            </Form.Item>

            <Form.Item
              label="Password"
              name="password"
              rules={[
                {
                  required: true,
                  message: "Please input your password!"
                }
              ]}
            >
              <Input.Password />
            </Form.Item>

            <Form.Item {...tailLayout}>
              <Button type="primary" htmlType="submit">
                Submit
              </Button>
            </Form.Item>
          </Form>
        </Col>
      </Row>
    </Fragment>
  );
};

export default SignIn;
